import { Component, Input} from '@angular/core';

@Component({
  selector: 'app-experience',
  templateUrl: './experience.component.html',
  styleUrls: ['./experience.component.scss']
})
export class ExperienceComponent {
  @Input() title:string = "Mes expériences";

}

<section class="jumbotron text-center">
  <div class="container">
    <br />
    <h1 class="jumbotron-heading">{{title}}</h1>
  </div>
</section>
<br />

<div class="list-group">
  <a routerLink="" class="list-group-item list-group-item-action">FORMATION CONCEPTER DEVELOPPEUR D4'APPLICATIONS - CESI</a>
  <a href="#" class="list-group-item list-group-item-action">DEVELOPPEUR INFORMATIQUE - CESI</a>
  <a href="#" class="list-group-item list-group-item-action">FACULTE DE SCIENCES BORDEAUX - LICENCE GEOLOGIE </a>
</div>
